class NextQRCode{constructor(element){this.element=element;this.init()}
static instances=[];static destroyAll(){NextQRCode.instances.forEach(instance=>instance.destroy());NextQRCode.instances=[]}
init(){this.element.removeAttribute('data-flickering')}
destroy(){this.element=null}}
function dancepad_qr_code(){NextQRCode.destroyAll();document.querySelectorAll('.dan-qr-code').forEach(element=>{const instance=new NextQRCode(element);NextQRCode.instances.push(instance)})}